import React from "react";

const ClearOutput = () => {
    const Name = document.getElementById('name');
    const Phone = document.getElementById('phone-number');
    const Email = document.getElementById('email-address');
    const Password = document.getElementById('password');

    if (!(Email.value === "") || !(Password.value === "") || !(Name.value === "") || !(Phone.value === "")) {
        Name.value = "";
        Phone.value = "";
        Email.value = "";
        Password.value = "";
    }
};

const Signup = () => {
    return (
        <div className="login-container">
            <div className="login-form-container">
                <h2 className="login-title">Student Sign Up</h2>
                <form className="login-form">
                    <div className="form-group">
                        <label className="form-label" htmlFor="name">Name</label>
                        <input className="form-input" type="text" name="name" id="name" />
                    </div>
                    <div className="form-group">
                        <label className="form-label" htmlFor="phone-number">Phone Number</label>
                        <input className="form-input" type="tel" name="phone-number" id="phone-number" />
                    </div>
                    <div className="form-group">
                        <label className="form-label" htmlFor="email-address">Email address</label>
                        <input className="form-input" type="email" name="email-address" id="email-address" />
                    </div>
                    <div className="form-group">
                        <label className="form-label" htmlFor="password">Password</label>
                        <input className="form-input" type="password" name="password" id="password" />
                    </div>
                    <div className="form-actions">
                        <input className="login-btn" type="submit" value="Sign Up" />
                        <input className="clear-btn" type="reset" value="Clear" onClick={ClearOutput} />
                    </div>
                </form>
            </div>
            <footer className="footer">
                <small className="copyright">Â© Created by Group CB, All Rights Reserved.</small>
            </footer>
        </div>
    );
}

export default Signup;
